import Header from "../components/Header";
import Footer from "../components/Footer";

const Layout = (props) => {
  return (
    <div className="site-wrapper">
      <Header />

      <div className="content-wrapper">{props.children}</div>

      <Footer />

      <style jsx global>
        {`
          *::before,
          *::after {
            box-sizing: border-box;
          }
        `}
      </style>
    </div>
  );
};

export default Layout;
